import React, { Component } from 'react'

class Navbar extends Component{
    render(){
        return(
            <nav>
                <div className="nav-wrapper red">
                <a href="#" className="brand-logo">Logo</a>
                </div>
            </nav>
        )
    }
}

export default Navbar
